import React from 'react';

import { MdMoreHoriz } from 'react-icons/md';

import { Container, Badge, MoreList, More } from './styles';

export default function MoreBtn() {
  return (
    <Container>
      <Badge>
        <MdMoreHoriz color="#666" size={20} />
      </Badge>

      <MoreList>
        <More>
          <MdMoreHoriz />
        </More>
      </MoreList>
    </Container>
  );
}
